function initMapFrame(n){var i=L.map("mapFrame"),e,o,t,r,u,f;for(L.tileLayer("https://tile.thunderforest.com/transport/{z}/{x}/{y}{r}.png?apikey=222b90f9396e4a3498d9292cc89be080",{attribution:'Mapy © <a href="http://www.thunderforest.com/">Thunderforest<\/a> | Mapová data © <a href="http://openstreetmap.org/copyright">přispěvatelé OpenStreetMap<\/a>',maxZoom:18}).addTo(i),e=n.lines,o=[],t=0;t<e.length;++t)for(r=e[t],L.polyline(r,{color:lineColorPalette[t%lineColorPalette.length]}).addTo(i),u=0;u<r.length;++u)o.push(r[u]);for(f=n.points,t=0;t<f.length;++t)L.marker(f[t].coords,{title:f[t].title}).addTo(i);i.fitBounds(L.latLngBounds(o))}var lineColorPalette=["#e6194b","#3cb44b","#ffe119","#4363d8","#f58231","#911eb4","#46f0f0","#f032e6","#bcf60c","#fabebe","#008080","#e6beff","#9a6324","#fffac8","#800000","#aaffc3","#808000","#ffd8b1","#000075","#808080","#ffffff","#000000"];